import React from "react";
import ReactDOM from "react-dom";

const Header = (props) => {
  return <div>{props.course}</div>;
};

const Content = (props) => {
  return (
    <div>
      <p> {props.part1}</p>
      <p> {props.part2}</p>
      <p> {props.part3}</p>
    </div>
  );
};
const Total = (props) => {
  return (
    <div>
      <p>{props.exercises1} </p>
      <p> {props.exercises2}</p>
      <p> {props.exercises3}</p>
    </div>
  );
};
const App = () => {
  const course = "Half Stack application development";
  const part1 = "Fundamentals of React";
  const exercises1 = 10;
  const part2 = "Using props to pass data";
  const exercises2 = 7;
  const part3 = "State of a component";
  const exercises3 = 14;

  return (
    <div>
      <Header course={course} />
      <ul>
        <li>
          <Content part1={part1} /> <Total exercises1={exercises1} />
          <li></li>
          <Content part2={part2} /> <Total exercises2={exercises2} />
        </li>
        <li>
          {" "}
          <Content part3={part3} /> <Total exercises3={exercises3} />{" "}
        </li>
      </ul>
    </div>
  );
};

ReactDOM.render(<App />, document.getElementById("root"));
